	title: '版本说明 - v2.3.7',
	description: 'Rancher 2.3.7 版本于 2020 年 5 月 7 日发布。本文介绍了 Rancher 2.3.7 相较上一版本（2.3.6）的重大改动、新增的实验性功能、已修复的问题和已知问题。',
