const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Rancher 2.3.7 版本于 2020 年 5 月 7 日发布。本文介绍了 Rancher 2.3.7 相较上一版本（2.3.6）的重大改动、新增的实验性功能、已修复的问题和已知问题。单击`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/releases/tag/v2.3.7"
      }}>{`这里`}</a>{`查看英文版版本说明。`}</p>
    <h2 {...{
      "id": "重要说明"
    }}>{`重要说明`}</h2>
    <ul>
      <li parentName="ul">{`如果您打算从 v2.2 版本升级到 v2.3.7，请务必查看`}<a parentName="li" {...{
          "href": "/docs/rancher2/releases/v2.3.0"
        }}>{`v2.3.0 版本说明`}</a>{`中的重要更新和重大改动的说明。`}</li>
    </ul>
    <p>{`下面的版本为当前的最新版和稳定版：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": "left"
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Rancher 版本`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Docker 标签`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Helm 仓库`}</th>
          <th parentName="tr" {...{
            "align": "left"
          }}>{`Helm Chart 版本`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`最新版`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.3`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`rancher/rancher:latest`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`server-charts/latest`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.3`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": "left"
          }}>{`稳定版`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.3`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}><inlineCode parentName="td">{`rancher/rancher:stable`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`server-charts/stable`}</td>
          <td parentName="tr" {...{
            "align": "left"
          }}>{`v2.4.3`}</td>
        </tr>
      </tbody>
    </table>
    <p>{`您可以通过`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/server-tags/_index"
      }}>{`如何选择版本的文档`}</a>{`，了解更多关于不同版本和标签的区别。`}</p>
    <h2 {...{
      "id": "功能和优化"
    }}>{`功能和优化`}</h2>
    <ul>
      <li parentName="ul">{`监控增强：`}<ul parentName="li">
          <li parentName="ul">{`Remote Read 和 Remote Write 支持[`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/20624"
            }}>{`#20624`}</a>{`]：能够进行远程读/写。这允许与远端存储进行集成。`}</li>
          <li parentName="ul">{`支持配置 livenessProbe [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/23983"
            }}>{`#23983`}</a>{`]：能够配置监控组件中的工作负载的 livenessProve 选项。`}</li>
        </ul></li>
      <li parentName="ul">{`支持一种新的 DNS 插件 nodelocal DNS [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/25811"
        }}>{`#25811`}</a>{`]`}</li>
    </ul>
    <h2 {...{
      "id": "实验性功能"
    }}>{`实验性功能`}</h2>
    <p>{`我们提供了一种启停 Rancher 中实验性功能模块的能力。在这个版本里，您可以通过 UI 来控制“功能开关”。详情请查阅`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/feature-flags/_index"
      }}>{`在 Rancher 中如何开启某些功能`}</a>{`的文档。`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/installation/options/feature-flags/enable-not-default-storage-drivers/_index"
        }}>{`在 UI 中启用非默认激活的存储驱动（例如：Ceph）`}</a></li>
    </ul>
    <h2 {...{
      "id": "自-v236-以来修复的主要问题"
    }}>{`自 v2.3.6 以来修复的主要问题`}</h2>
    <ul>
      <li parentName="ul">{`Rancher UI 中禁止编辑 EKS 中的某些字段，因为这些字段在 AWS 控制台上就是不可编辑的 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24652"
        }}>{`#24652`}</a>{`]`}</li>
      <li parentName="ul">{`阿里云主机驱动支持设置按流量付费和按带宽付费 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/15847"
        }}>{`#15847`}</a>{`]`}</li>
      <li parentName="ul">{`修复了导入集群的节点无法添加标签的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/26496"
        }}>{`#26496`}</a>{`]`}</li>
      <li parentName="ul">{`修复了监控在某些情况下 Pod CPU 和内存使用量翻倍的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/26594"
        }}>{`#26594`}</a>{`]`}</li>
      <li parentName="ul">{`修复无法更换 EKS 集群使用的 AWS API 密钥的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/25835"
        }}>{`#25835`}</a>{`]`}</li>
      <li parentName="ul">{`修复了在 AWS 控制台修改 EKS 集群后，导致无法在 Rancher 中升级 EKS 集群版本的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24171"
        }}>{`#24171`}</a>{`]`}</li>
      <li parentName="ul">{`修复了通过 API 升级项目级别应用商店中的应用时，需要传入 projectId 的问题 [`}<a parentName="li" {...{
          "href": "https://github.com/rancher/rancher/issues/24371"
        }}>{`#24371`}</a>{`]`}</li>
    </ul>
    <h2 {...{
      "id": "其他说明"
    }}>{`其他说明`}</h2>
    <h3 {...{
      "id": "离线安装和升级"
    }}>{`离线安装和升级`}</h3>
    <p>{`在 v2.3.0+的版本里，离线安装将不在需要手动同步 system charts 的源代码仓库了。具体操作请参阅有关`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/other-installation-methods/air-gap/install-rancher/_index"
      }}>{`安装 Rancher 时，如何使用内嵌的 system charts`}</a>{`。`}</p>
    <h3 {...{
      "id": "主要的已知问题"
    }}>{`主要的已知问题`}</h3>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`NGINX ingress controller 0.25.0 版本仅支持有 SSE4.2 指令集的 CPU [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/23307"
          }}>{`#23307`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`Windows 集群限制 - 由于其他上游依赖的原因，Windows 集群有一些已知的限制：`}</p>
        <ul parentName="li">
          <li parentName="ul">{`在使用 Flannel VXLAN (Overlay) 模式时， Windows Pods 无法访问 Kubernetes API。临时解决方案是使用 Flannel Host Gateway (L2bridge)模式。该问题将在 k8s 1.18 版本中修复。[`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/20968"
            }}>{`#20968`}</a>{`]`}</li>
        </ul>
        <ul parentName="li">
          <li parentName="ul">{`Windows 集群的日志功能仅在 Flannel Host Gateway (L2bridge)模式下可以使用。该问题将在 k8s 1.18 版本中修复。[`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/20510"
            }}>{`#20510`}</a>{`]`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`HPA 限制 - 因为 GKE 不支持`}<inlineCode parentName="p">{`v2beta2.autoscaling`}</inlineCode>{`版本的 API。所以在 Rancher UI 中无法通过 UI 管理 GKE 集群的 HPA 资源。[`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22292"
          }}>{`#22292`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`安全加固限制 - 如果您按照 Rancher 的安全加固手册进行了配置，那么您将会遇到一些已知的问题。`}</p>
        <ul parentName="li">
          <li parentName="ul">{`Rancher UI 中的 kubectl 将无法工作 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/19439"
            }}>{`#19439`}</a>{`]`}</li>
          <li parentName="ul">{`流水线将无法工作 [`}<a parentName="li" {...{
              "href": "https://github.com/rancher/rancher/issues/22844"
            }}>{`#22844`}</a>{`]`}</li>
        </ul>
      </li>
      <li parentName="ul">
        <p parentName="li">{`如果您是从 v2.2 升级上来的环境，在向已有节点模版中添加的 Taints 后，并使用这个节点模版来扩容 Worker 节点，那么这些新的 Worker 节点可能无法正常工作。您必须在对管理节点或 etcd 节点进行扩缩容后，或是对集群进行编辑后，这些带有 Taints 的新 Worker 节点才能正常工作。因为只有在集群 Reconcile 被触发后，系统组件才会自动添加 Tolerations [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/22672"
          }}>{`#22672`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`在升级 Rancher 版本后，集群告警组件或集群日志组件有可能会卡在`}<inlineCode parentName="p">{`Updating`}</inlineCode>{`状态。临时解决方案可以在这个 issue 中找到。[`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/21480"
          }}>{`#21480`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`如果您的 Rancher Server 所在的集群配置了 OpenStack cloud provider 并设置了 LoadBalancer，并且这个 Rancher Server 所在的集群是在 v2.2.3 或者更早的版本创建的，那么直接升级到 Rancher v2.2.4 或之后的版本将会失败。您可以在这个 issue 的评论中找到这种情况下的迁移方法 [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/20699"
          }}>{`#20699`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`如果集群配置了 cloud provider，且以主机名或 FQDN 注册的 agents（并且通过 IP 地址注册），kube-proxy 将无法启动。您可以通过节点的 API 的返回值来进行确认。[`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rke/issues/1725"
          }}>{`RKE#1725`}</a>{`]`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`由于更新了 Fluentd Kubernetes metadata 插件的原因，Rancher 日志采集的格式发送了变化。json 格式的日志将不能被处理，所以在采集到的日志里将无法把 json 格式日志合并作为顶层键。我们在这个 issue 中，通过另外一种方式，重新提供了这个能力 [`}<a parentName="p" {...{
            "href": "https://github.com/rancher/rancher/issues/23646"
          }}>{`#23646`}</a>{`]`}</p>
      </li>
    </ul>
    <h2 {...{
      "id": "版本信息"
    }}>{`版本信息`}</h2>
    <h3 {...{
      "id": "镜像"
    }}>{`镜像`}</h3>
    <ul>
      <li parentName="ul">{`rancher/rancher:v2.3.7`}</li>
      <li parentName="ul">{`rancher/rancher-agent:v2.3.7`}</li>
    </ul>
    <h3 {...{
      "id": "工具"
    }}>{`工具`}</h3>
    <ul>
      <li parentName="ul">{`cli - `}<a parentName="li" {...{
          "href": "https://github.com/rancher/cli/releases/tag/v2.3.2"
        }}>{`v2.3.2`}</a></li>
      <li parentName="ul">{`rke - `}<a parentName="li" {...{
          "href": "https://github.com/rancher/rke/releases/tag/v1.0.7"
        }}>{`v1.0.7`}</a></li>
    </ul>
    <h3 {...{
      "id": "kubernetes-版本"
    }}>{`Kubernetes 版本`}</h3>
    <blockquote>
      <p parentName="blockquote">{`注：在 v2.3.0+版本中，在有新的 Kubernetes 版本可用时，即使不升级 Rancher 版本，我们也会自动向您推送这些版本。所以您在 Rancher UI 中看到的可用版本，可能会高于如下版本。`}</p>
    </blockquote>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/v1.17.5-rancher1"
        }}>{`1.17.5`}</a>{` (默认版本)`}</li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/v1.16.9-rancher1"
        }}>{`1.16.9`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/rancher/hyperkube/releases/tag/v1.15.11-rancher1"
        }}>{`1.15.11`}</a></li>
    </ul>
    <h2 {...{
      "id": "升级和回滚"
    }}>{`升级和回滚`}</h2>
    <div {...{
      "className": "admonition admonition-important alert alert--info"
    }}><div parentName="div" {...{
        "className": "admonition-heading"
      }}><h5 parentName="div"><span parentName="h5" {...{
            "className": "admonition-icon"
          }}><svg parentName="span" {...{
              "xmlns": "http://www.w3.org/2000/svg",
              "width": "14",
              "height": "16",
              "viewBox": "0 0 14 16"
            }}><path parentName="svg" {...{
                "fillRule": "evenodd",
                "d": "M7 2.3c3.14 0 5.7 2.56 5.7 5.7s-2.56 5.7-5.7 5.7A5.71 5.71 0 0 1 1.3 8c0-3.14 2.56-5.7 5.7-5.7zM7 1C3.14 1 0 4.14 0 8s3.14 7 7 7 7-3.14 7-7-3.14-7-7-7zm1 3H6v5h2V4zm0 6H6v2h2v-2z"
              }}></path></svg></span>{`重要`}</h5></div><div parentName="div" {...{
        "className": "admonition-content"
      }}><p parentName="div">{`在回滚的时候，您将会被回滚到升级之前的状态。任何在升级后进行的改动将无法被保留。`}</p></div></div>
    <p>{`Rancher 支持`}<a parentName="p" {...{
        "href": "/docs/rancher2/upgrades/_index"
      }}>{`升级`}</a>{`和`}<a parentName="p" {...{
        "href": "/docs/rancher2/upgrades/rollbacks/_index"
      }}>{`回滚`}</a>{`操作。在修改 Rancher 版本时，请先确认您要升级到或者回滚到的 Rancher 版本。`}</p>
    <p>{`请注意，在升级到 v2.3.0 或者以上版本时，第一次修改通过 Rancher v2.3.0 之前版本部署的 RKE 集群时，由于要向系统组件中加入 Tolerations，该集群全部的系统组件将会自动重启。请事先规划好。`}</p>
    <p>{`如果您的 Rancher HA 在使用 低于 v0.9.1 的 cert-manager，并且是自签名证书，由于 cert-manager 最新的变化，您需要升级 cert-manager 的版本。具体操作请参阅有关`}<a parentName="p" {...{
        "href": "/docs/rancher2/installation/options/upgrading-cert-manager/_index"
      }}>{`如何升级 cert-manager`}</a>{`的文档。`}</p>
    <h2 {...{
      "id": "assets"
    }}>{`Assets`}</h2>
    <p>{`请在`}<a parentName="p" {...{
        "href": "https://github.com/rancher/rancher/releases/tag/v2.3.7"
      }}>{`这里`}</a>{`获取该版本的 Assets。`}</p>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
